import React, {Component} from 'react';
import {Form, Button} from "react-bootstrap";

class Member extends Component {
    
    user_insert=()=>{
        const send_param = {
            nickname: this.nickE.value,
            email: this.emailE.value,
            pwd: this.pwdE.value,
            company: this.companyE.value
        }
        console.log(send_param);
    }
    render(){
        return(
            <div>
                <h2>로그인 화면</h2>
                <Form.Group controlId="formBasicEmail">
                    <Form.Control type="email" placeholder="Enter email" ref={ref=>this.emailE=ref} required/>
                    <Form.Text className="text-muted">
                    We'll never share your email with anyone else.
                    </Form.Text><br/>
                    <Form.Control type="text" placeholder="Enter Nickname" ref={ref=>this.nickE=ref} required/>
                    <Form.Control type="text" placeholder="Enter Company" ref={ref=>this.companyE=ref} required/>
                </Form.Group>
                
                <Form.Group controlId="formBasicPassword">
                    <Form.Control type="password" placeholder="Enter Password" ref={ref=>this.pwdE=ref} required/>
                </Form.Group>
      
      

                <Form.Group controlId="exampleForm.ControlSelect1">
                    <Form.Label>Company Type</Form.Label>
                    <Form.Control as="select">
                    <option>IT</option>
                    <option>유통/무역</option>
                    <option>서비스업</option>
                    <option>공기업/공공기관</option>
                    <option>기타</option>
                    </Form.Control>
                </Form.Group>

                <Form.Group controlId="formBasicCheckbox">
                    <Form.Check type="checkbox" label="Check me out" />
                </Form.Group>

                <Button variant="primary" type="submit" onClick={this.user_insert}>제출</Button>
                        {/* <input type="text" placeholder="nickname" id="new_nickname" required/><br/>
                        <input type="password" placeholder="Password" id="new_password" required/><br/>
                        <input type="text" placeholder="company" id="new_company" /><br/>
                    <Button id="register">제출하기</Button> */}
         
            </div>
        );
    }
}

export default Member;
